import main from "../careerly_css/main.css";
import { FaUserCircle } from "react-icons/fa";

function CareerlyMain() {
  return (
    <main>
      <body className="posts">
        <div className="writer">
          <FaUserCircle size="34" />
          <h5>username</h5>
          <h5>2일전</h5>
        </div>
        <div>
          <h5>
            제품 중심의 사고란 무엇인가 1. 사람들은 사용자 경험(User
            Experience), 소위 말하는 UX를 떠올릴 때, 사용자의 삶을 더 쉽게
            만들어주는, 1) 단순하고, 2) 아름다우며, 3) 사용하기 쉬운, 일련의
            기능들을 떠올립니다. ... 더 보기
          </h5>
        </div>
      </body>
    </main>
  );
}

export default CareerlyMain;
